import React from 'react'
import logo from './logo.png'

export default function Navbar() {
    return (
        <nav className="navbar h-navbar fixed-top bg-light main-hd container-fluid">
            <div className="row h-100">
                <img src={logo}></img>
            </div>
        </nav>
    )
}
